INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (72, 'Pta', 'Peseta', 'Spanish peseta', '1869', '2002-02-28', 74, 166.386, 'The name of the currency comes from "pesseta", a Catalan diminutive of the Catalan word peça (meaning piece or fraction) or the Spanish Peso. The word peseta has been known as early as 1737 to colloquially refer to the coin worth 2 reales provincial or ​1⁄5 of a peso.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (238, NULL, 'Dinar', 'South Yemeni dinar', '1965', '1996-06-11', NULL, NULL, NULL, 'Dinars');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (137, 'den', 'Denar', 'Macedonian denar', '1993-05-01', NULL, NULL, NULL, 'In May 1993, the currency was reformed. A new denar was introduced, with one new denar being equal to 100 old denari', 'Denari');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (23, 'KM', 'Convertible Mark', 'Bosnia and Herzegovina convertible mark', '1998-06-22', NULL, NULL, NULL, 'The convertible mark was established by the 1995 Dayton Agreement. It replaced the Bosnia and Herzegovina dinar, Croatian kuna and Republika Srpska dinar as the single currency of Bosnia and Herzegovina in 1998. Mark refers to the German mark, the currency to which it was pegged at par.', 'Convertible Marks');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (240, 'din', 'Dinar', 'Yugoslav hard dinar', '1966-01-01', '1989-12-31', 243, 10000, 'This was the first revaluation of the Yugoslav Dinar, at a ratio of 100 to 1.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (132, NULL, 'Franc', NULL, '1921', '1976', 131, NULL, NULL, 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (133, 'F', 'Franc', 'Monégasque franc', '1960', '1995-03-31', 78, NULL, NULL, 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (9, 'Kz', 'Kwanza', 'Angolan kwanza', '1999-12-01', NULL, NULL, NULL, 'The currency derives its name from the Kwanza River.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (22, NULL, 'Dinar', '(First) Bosnia and Herzegovina dinar', '1992-07-01', '1994', 298, 10000, 'The first Bosnian dinar was issued in July, 1992, replacing the 1990 version of Yugoslav dinar at the rate of 1 Bosnia dinar = 10 Yugoslav "1990 dinara". Consequently, the Bosnian dinar was at par with the 1992 version of the Yugoslav dinar when it was introduced.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (179, '₽', 'Ruble', 'Russian ruble', '1998-01-01', NULL, NULL, NULL, 'This redenomination was an administrative step that reduced the unwieldiness of the old ruble but occurred on the brink of the 1998 Russian financial crisis. The ruble lost 70% of its value against the US dollar in the six months following this financial crisis.', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (42, 'Nu', 'Ngultrum', 'Bhutanese ngultrum', '1974', NULL, NULL, NULL, 'The term derives from the Dzongkha ngul, "silver" and trum, a Hindi loanword meaning "money".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (45, 'Br', 'Ruble', 'Belarusian ruble', '2016-07-01', NULL, NULL, NULL, 'In July 2016, a new ruble was introduced, at a rate of 1 BYN = 10,000 BYR. Old and new rubles circulated in parallel from 1 July to 31 December 2016. Belarus also issued coins for general circulation for the first time.', 'Rubles');
