INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (249, 'NZ', 'New Zaire', 'Zairean new zaire', '1993', '1997', 49, 100000, 'The New Zaire was replaced by the Congolese franc again on 1 July 1998, shortly after the Republic of Zaire became the Democratic Republic of the Congo once more, on 16 May 1997.', 'New Zaires');
