INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (211, NULL, 'Pa''anga', NULL, '0', NULL, NULL, NULL, NULL, NULL);
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (89, NULL, 'Quetzal', 'Guatemalan quetzal', '1925', NULL, NULL, NULL, 'The currency was named after the national bird of Guatemala, the resplendent quetzal. In ancient Mayan culture, the quetzal bird''s tail feathers were used as currency.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (8, 'ƒ', 'Guilder', 'Netherlands Antillean guilder', '1892', NULL, NULL, NULL, 'Currency began to be issued specifically for use in the Netherlands Antilles in the name of Curaçao. The first banknotes were introduced in 1892. The name "Netherlands Antilles" (Nederlandse Antillen) was introduced in 1952. In 2010 the Netherland Antilles ceased to exist but Curaçao and Sint Maarten continued issuing the Netherlands Antillean Guilder.', 'Guilders');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (250, 'Z', 'Zaïre', 'Zairean zaire', '1967', '1993', 249, 3e+06, 'The Zaire was introduced in 1967, replacing the Congolese franc, and was replaced by the New Zaire due to high inflation.', 'Zaires');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (120, '₸', 'Tenge', 'Kazakhstani tenge', '1993-11-15', NULL, NULL, NULL, 'On November 12, 1993, the President of Kazakhstan issued a decree "On introducing national currency of Republic of Kazakhstan". The tenge was introduced on 15 November 1993 to replace the Soviet ruble at a rate of 1 tenge = 500 rubles.', 'Tenge');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (282, 'din', 'Dinar', 'Yugoslav dinar', '1919', '1941', 289, 20, 'Until 1918, the dinar was the currency of Serbia. It then became the currency of the Kingdom of Serbs, Croats and Slovenes, circulating alongside the krone in Croatia, Slovenia and Bosnia and Herzegovina, with 1 dinar = 4 kronen. The first banknotes bearing the name of the Kingdom of Serbs, Croats and Slovenes were issued in 1920, until which time Serbian banknotes circulated. In 1929, the name of the country changed to the Kingdom of Yugoslavia and this was reflected on the currency', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (55, 'din', 'Dinar', 'Serbian dinar', '2003-07-03', NULL, NULL, NULL, 'The Serbian dinar replaced the Yugoslav dinar in 2003, when the Federal Republic of Yugoslavia was transformed into the State Union of Serbia and Montenegro. Between 2003 and 2006, the Serbian dinar used the ISO 4217 code CSD, with CS being the ISO 3166-2 country code for Serbia and Montenegro. When the State Union was dissolved in 2006, the dinar''s ISO 4217 code was changed to the current RSD.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (241, 'din', 'Dinar', 'Yugoslav dinar', '1994-01-01', '1994-01-23', 242, 1.3e+07, 'Yugoslavia re-denominated the dinar for at a ratio of 1 billion to 1.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (244, 'din', 'Dinar', 'Yugoslav dinar', '1993-10-01', '1993-12-31', 241, 1e+09, 'Yugoslavia re-denominated the dinar for the fourth time on 1 October 1993, at a ratio of 1 million to 1. ', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (245, 'din', 'Dinar', 'Yugoslav reformed dinar', '1992-07-01', '1993-09-30', 244, 1e+06, 'This was the third revaluation of the Yugoslav dinar, at a ratio of 10 to 1.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (243, 'din', 'Dinar', 'Yugoslav convertible dinar', '1990-01-01', '1992-06-30', 245, 10, 'The second revaluation of the Yugoslav dinar took place on 1 January 1990, at a ratio of 10,000 to 1. During this period, the constituent republics began to leave the Socialist Federal Republic of Yugoslavia. Four of the six republics declared independence and started issuing their own currencies shortly after. This was the last dinar that bore the coat of arms and the name of the "Socialist Federal Republic of Yugoslavia".', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (281, 'din', 'Dinar', 'Federation dinar', '1944', '1965', 240, 100, 'In 1944, as Yugoslavia began to be reconstituted, the Yugoslav dinar replaced the Serbian dinar, Independent State of Croatia kuna and other occupation currencies, with the rates of exchanged being 1 Yugoslav dinar = 20 Serbian dinara = 40 kuna.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (288, NULL, 'Krone', 'Yugoslav krone', '1919', '1922', 282, 4, 'The krone replaced the Austro-Hungarian krone at par on November 12, 1918. It circulated alongside the Serbian dinar in State of Slovenes, Croats and Serbs with an exchange rate of 1 dinar = 4 kronen in the intermediate time before the adoption of the Yugoslav dinar. The exact date at which the krone ceased to circulate is unclear, with one source indicating that the krone was still in circulation at the end of 1922', 'Kronen');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (92, 'HK$', 'Dollar', 'Hong Kong dollar', '1935', NULL, NULL, NULL, ' In 1863, the Royal Mint in London began issuing special subsidiary coinage for use in Hong Kong within the dollar system. In the 1860s, banknotes of the new British colonial banks, the Hong Kong and Shanghai Banking Corporation and the Chartered Bank of India, Australia and China, denominated in dollars, also began to circulate in both Hong Kong and the wider region.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (287, 'din', 'Dinar', 'Serbian dinar', '1868', '1920', 282, 1, 'After the last Ottoman garrisons were withdrawn in 1867, Serbia was faced with multiple currencies in circulation. Thus, prince Mihailo Obrenović ordered a national currency be minted. The first bronze coins were introduced in 1868. The first banknotes were issued in 1876. Between 1873 and 1894, the dinar was pegged at par to the French franc. The Kingdom of Serbia also joined the Latin Monetary Union.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (289, 'din', 'Dinar', 'Serbian dinar', '1941', '1944', 281, 20, 'In 1941, the Yugoslav dinar was replaced, at par, by a second Serbian dinar for use in the German occupied Serbia. The dinar was pegged to the German reichsmark at a rate of 250 dinars = 1 Reichsmark. This dinar circulated until 1944, when the Yugoslav dinar was reintroduced by the Yugoslav Partisans, replacing the Serbian dinar at a rate of 1 Yugoslav dinar = 20 Serbian dinars', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (290, 'Kn', 'Kuna', 'Independent State of Croatia kuna', '1941-07-26', '1945-07-09', 281, 40, 'The kuna was the currency of the Independent State of Croatia in the period between 1941 and 1945 during World War II. It replaced the Yugoslav dinar at par and was fixed to the German Reichsmark.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (142, 'MOP$', 'Pataca', 'Macanese pataca', '1952', NULL, NULL, NULL, 'The pataca was introduced in Portuguese Macau and Portuguese Timor in the year 1894, but only as a unit of account. The unit initially corresponded to the Mexican Peso, and it replaced the Portuguese real at a rate of 1 pataca = 450 réis. The name pataca derives from the fact that the Portuguese always referred to the Mexican Peso as the pataca mexicana.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (139, NULL, 'Franc', NULL, '1962', '1984-01-01', 236, NULL, NULL, 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (128, NULL, 'Franc', NULL, '1944', '2002-02-28', NULL, NULL, NULL, 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (30, NULL, 'Franc', 'Burundian franc', '0', NULL, NULL, NULL, NULL, 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (26, NULL, 'Franc', NULL, '1832', '2002-02-28', NULL, NULL, NULL, 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (286, 'F', 'Franc', 'French Franc', '1795', '1960', 78, 100, 'Between 1360 and 1641, the Franc was the name of coins worth 1 livre tournois and it remained in common parlance as a term for this amount of money. It was reintroduced (in decimal form) in 1795. In 1960, due to inflation it was replaced by the new franc (NF)', 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (78, 'F', 'Franc', 'French franc', '1960-01-01', '2002-02-28', NULL, NULL, 'In January 1960 the French franc was revalued, with 100 existing francs making one "nouveau franc". The abbreviation "NF" was used until 1963.', 'Francs');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (236, 'CFA', 'West African CFA Franc', NULL, '1945', NULL, NULL, NULL, 'The CFA franc was introduced to the French colonies in West Africa in 1945, replacing the French West African franc. The West African colonies and territories using the CFA franc were Ivory Coast, Dahomey, French Sudan, Mauritania, Niger, Sénégal, Togo and Upper Volta. The currency continued in use when these colonies gained their independence, except in Mali (formerly French Sudan), which replaced at par the CFA franc with its own franc in 1961.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (192, 'Sk', 'Koruna', 'Slovak koruna', '1993-02-08', '2008-12-31', 74, 30.126, 'In 1993, the newly independent Slovakia introduced its own koruna, replacing the Czechoslovak koruna at par. It was the currency of Slovakia between 8 February 1993 and 31 December 2008, and could be used for cash payment until 16 January 2009.', 'Korun');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (56, 'Kčs', 'Koruna', 'Czechoslovak koruna', '1953-06-01', '1993-02-08', NULL, NULL, 'The Czechoslovak koruna (crown) was the currency of Czechoslovakia from April 10, 1919, to March 14, 1939, and from November 1, 1945, to February 7, 1993. For a brief time in 1939 and again in 1993, it was also the currency in separate Czech and Slovak republics.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (291, 'Kčs', 'Koruna', 'Czechoslovak koruna', '1919-04-10', '1939-03-14', NULL, NULL, 'The Czechoslovak koruna (crown) was the currency of Czechoslovakia from April 10, 1919, to March 14, 1939. For a brief time in 1939, it was also the currency in separate Czech and Slovak republics. Afterwards, separate currencies for Bohemia and Moravia and Slovakia were introduced, at par with the Czechoslovak koruna. These were the Bohemian and Moravian koruna and the Slovak koruna.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (292, 'Kčs', 'Koruna', 'Czechoslovak koruna', '1944', '1953-05-30', 56, 50, 'After the II World war, officially in November 1, 1945, the Czechoslovak koruna was re-established, replacing the two previous currencies at par.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (61, 'Kč', 'Koruna', 'Czech koruna', '1993', NULL, NULL, NULL, 'The Czech koruna replaced at par the Czechoslovak koruna when it was introduced in 1993 after the dissolution of Czechoslovakia.', 'Korun');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (71, 'Nkf ', 'Nakfa', 'Eritrean nakfa', '1997-11-08', NULL, NULL, NULL, 'The nakfa was introduced in 1997 to replace the Ethiopian birr at par. The currency takes its name from the Eritrean town of Nakfa, site of the first major victory of the Eritrean War of Independence', 'Nakfa');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (298, 'din', 'Dinar', '(Second) Bosnia and Herzegovina dinar', '1994', '1998-02-04', 23, NULL, 'A second dinar was introduced in 1994, replacing the first at a rate of 1 "new" dinar = 10,000 "old" dinara. Both these dinars were restricted in their circulation to the areas under Bosniak control. The Croat areas used the Croatian dinar and kuna, whilst the Serb areas used the Republika Srpska dinar.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (293, 'din', 'Dinar', '(First) Republika Srpska dinar', '1992', '1993-09-30', 294, 1e+06, 'The dinar was introduced in 1992 in conjunction with the Yugoslav dinar of that year (YUR), to which it was equal. ', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (294, 'din', 'Dinar', '(Second) Republika Srpska dinar', '1993-10-01', '1993-12-31', 241, 1e+09, 'The second dinar was introduced on October 1, 1993, replacing the first at a rate of one million to one, matching the revaluation of the Yugoslav dinar (YUO). Following this, the Republika Srpska used Yugoslav currency: first the "1994 dinar" and then "novi dinar"', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (94, 'din', 'Dinar', 'Croatian dinar', '1991-12-23', '1994-05-30', 95, 1000, 'The Croatian dinar replaced the 1990 version of Yugoslav dinar at par. It was a transitional currency introduced following Croatia''s declaration of independence. During its existence the dinar declined in value by a factor of about 70.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (295, 'din', 'Dinar', '(First) Krajina dinar', '1992', '1993-09-30', 296, 1e+06, 'The dinar was introduced in 1992 in conjunction with the Yugoslav dinar of that year (YUR), to which it was equal. ', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (95, 'kn', 'Kuna', 'Croatian kuna', '1994-05-30', NULL, NULL, NULL, 'The word kuna means "marten" in Croatian, referring to the historical use of marten pelts as units of value in medieval trading. 
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (296, 'din', 'Dinar', '(Second) Krajina dinar', '1993-10-01', '1993-12-31', 297, 1e+09, 'The second dinar was introduced on October 1, 1993, replacing the first at a rate of one million to one, matching the revaluation of the Yugoslav dinar (YUO). ', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (297, 'din', 'Dinar', '(Third) Krajina dinar', '1994-01-01', '1994-01-23', 242, 1.3e+07, 'The third dinar was introduced on January 1, 1994, replacing the second at a rate of one billion to one, matching the revaluation of the Yugoslav dinar (YUG). Following this, Krajina used the Yugoslav currency (YUM) until Croatia took control of the region.', 'Dinara');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (138, 'den', 'Denar', 'Macedonian denar', '1992-04-26', '1993-06-30', 137, 100, 'The name "denar" (like the "dinar") comes from the name of the ancient Roman monetary unit, the denarius
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (97, 'Ft', 'Forint', 'Hungarian forint', '1946-08-01', NULL, NULL, NULL, 'The forint''s name comes from the city of Florence, where gold coins called fiorino d''oro were minted from 1252. In Hungary, florentinus (later forint), also a gold-based currency, was used from 1325. Between 1868 and 1892 the forint was the name used in Hungarian for the currency of the Austro-Hungarian Empire.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (299, 'P', 'Pengo', 'Hungarian pengo', '1927-01-01', '1946-07-31', 97, 4e+29, 'The Hungarian word pengő means ''ringing'', which in turn derives from the verb peng, an onomatopoeic word equivalent to English ''ring''. It was first used from the 15th to the 17th century to refer to silver coins.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (214, '₺', 'Lira', 'Turkish lira', '2005-01-01', NULL, NULL, NULL, 'The second Turkish Lira was introduced on 1 January 2005, replacing the previous Turkish lira (which remained valid in circulation until the end of 2005) at a rate of 1 second Turkish lira = 1,000,000 first Turkish lira. 
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (300, 'AP', 'Adopengo', 'Hungarian adopengo', '1946-01-01', '1946-07-31', 97, 2e+08, 'The adopengo (in English: "tax pengő") was a temporary unit of currency of Hungary introduced to try to stabilise the pengő. On 31 July 1946, both were replaced by the forint. Initially the adópengő was only an accounting unit used by the government and commercial banks with the same value as the pengo; later, bonds and savings certificates denominated in adópengő were also issued for the public, and replaced pengő notes in circulation. By 1 June 1946, the change was 160,000 pengo; on 1 July 1946, it had increased to	7,500,000,000 and the adópengő became the only circulating currency as the pengő''s value had fallen to such an extent that even the 100 million b.-pengő note was effectively worthless; finally on 31 July 1946 the change reached 2,000,000,000,000,000,000,000
(2 sextillion).', 'Adopengorol');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (301, 'K', 'Korona', 'Hungarian korona', '1920', '1926-12-31', 299, 12500, 'The Hungarian korona ("crown") was the replacement currency of the Austro-Hungarian Krone/korona in the newly created post-World War I Hungary. It replaced the Austro-Hungarian counterpart at par.  The overstamping of the banknotes of the Austro-Hungarian Bank started only in 1920. It suffered a serious inflation and was replaced by the pengő on 1 January 1927.', 'Korona');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (167, 'S/', 'Sol', 'Peruvian sol', '1991-07-01', NULL, NULL, NULL, 'The Nuevo Sol replaced the Peruvian inti in 1991 and the name is a return to that of Peru''s historic currency, as the previous incarnation of sol was in use from 1863 to 1985. 
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (12, 'Kz', 'Kwanza reajustado', 'Angolan kwanza reajustado', '1995-07-01', '1999-11-30', 9, 1e+06, 'It replaced the previous kwanza at a rate of 1,000 to 1. Only banknotes were issued.', 'Kwanzas reajustados');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (166, NULL, 'Inti', 'Peruvian inti', '1985-02-01', '1991-07-01', 167, 1e+06, 'The inti was introduced on 1 February 1985, replacing the sol which had suffered from high inflation. One inti was equivalent to 1,000 soles.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (165, NULL, 'Sol de Oro', 'Peruvian sol de oro', '1863', '1985-02-01', 166, 1000, 'Although sol in this usage is derived from the Latin solidus (English: solid), the word also means "sun" in Spanish.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (10, 'Kz', 'Kwanza', 'Angolan kwanza', '1977-01-08', '1990-09-24', 11, 1, 'Kwanza was introduced following Angolan independence. It replaced the escudo at par.', 'Kwanzas');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (307, NULL, 'Lira', 'Ottoman lira ', '1844', '1923', 213, 1, 'The Ottoman lira was the currency of Ottoman Empire between 1844 and 1923, when it was replaced by the Turkish lira. The Ottoman lira remained in circulation until the end of 1927.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (104, 'د.ع', 'Dinar', 'Iraqi dinar', '1932', NULL, NULL, NULL, 'The dinar was introduced into circulation in 1932, replacing the Indian rupee, which had been the official currency since the British occupation of the country in World War I, at a rate of 1 dinar = 11 rupees.', 'Dinars');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (11, 'Kz', 'Kwanza', 'Angolan kwanza ', '1990-09-25', '1995-06-30', 12, 1000, 'Although it replaced the kwanza at par, Angolans could only exchange 5% of all old notes for new ones. This kwanza suffered from high inflation. The name Novo (New) Kwanza was only used in the first issue of overprinted notes.', 'Kwanzas');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (302, NULL, 'Escudo', 'Angolan escudo', '1958', '1977', 10, 1, 'In 1953, Portugal began unifying the currencies of its colonies. This process was completed in Angola at the end of 1958, with the reintroduction of the escudo. The escudo was replaced in 1977 by the kwanza at par.', 'Escudos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (303, NULL, 'Angolar', 'Angolan angolar', '1928', '1958', 302, 1, 'The angolar was introduced in 1928 to replace the escudo. Banknotes were exchanged at a rate of 1 angolar = 1.25 escudos.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (304, NULL, 'Escudo', 'Angolan escudo', '1914', '1928', 303, 1.25, 'The introduction of the escudo in Portugal''s colonies took place in 1914, three years after it occurred in Portugal. The escudo replaced the real at a rate of 1000 réis = 1 escudo', 'Escudos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (305, NULL, 'Real', 'Angolan real', '1814', '1914', 304, 1000, 'The real was the currency of Portuguese Angola until 1914. It was equal to the Portuguese real. The real was replaced by the escudo in 1914.', 'Reis');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (306, NULL, 'Peso', 'Guatemalan peso', '1859', '1925', 89, 60, 'The peso replaced the real, with 1 peso = 8 reales. In 1869, the centavo was introduced, worth one hundredth of a peso, but the real continued to be produced until 1912, when Guatemala fully decimalize.', 'Pesos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (4, '؋', 'Afghani', 'Afghan afghani', '1925', '2002', 5, 1000, 'The original afghani was introduced in 1925, replacing the Afghan rupee that was used from 1891 and other currencies. The rate of conversion from the rupee is sometimes quoted as 1 afghani = 1 rupee 6 paisas, based on the silver contents of the last rupee coins and the first afghani coins. The afghani initially contained 9 grams of silver', 'Afghani ');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (46, 'Br', 'Ruble', 'Belarusian ruble', '2000-01-01', '2016-12-31', 45, 10000, 'A new ruble was introduced in 2000 replacing the first at a rate of 1 BYR = 1,000 BYB. Only banknotes have been issued.', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (5, '؋', 'Afghani', 'Afghan afghani', '2002-10-08', NULL, NULL, NULL, 'In 2002, the afghani was redenominated. No subdivisions were issued. It replaced the previous afghani at two distinct rates: issues of the government of former President Rabbani (de jure 1992-2001) were replaced at a rate of 1,000 to the new afghani, whilst the issues of warlord Dostum (1992–1997) in northern Afghanistan were replaced at a rate of 2,000 to the new afghani. 
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (105, '﷼', 'Rial', 'Iranian rial', '1932', NULL, NULL, NULL, 'The rial was re-introduced during the decimalisation in 1932, replacing the qiran at par. The rial was initially pegged to the British pound.', 'Rials');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (308, NULL, 'Qiran', 'Iranian qiran', '1825', '1932', 105, 1, 'The qiran, also qerun or kran, was the currency of Iran between 1825 and 1932. It was subdivided into 20 shahi or 1000 dinar and was worth one tenth of a toman. The qiran is no longer an official denomination but the term still enjoys wide usage among Iranians.', 'Qiran');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (309, NULL, 'Dollar', 'Mongolian dollar', '1921', '1925', 141, NULL, 'The dollar was the currency of Mongolia between 1921 and 1925. Treasury notes were issued in 1921. It was intended to replace the Chinese yuan at par but, according to European travellers of the time, was worthless.', 'Dollars');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (141, '₮', 'Tögrög', 'Mongolian tögrög', '1925-12-09', NULL, NULL, NULL, 'The word tögrög (төгрөг) refers to "circle", or a "circular object" (i.e. a coin).
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (180, 'руб', 'Ruble', 'Russian ruble', '1992', '1997-12-31', 179, 1000, 'Following the breakup of the Soviet Union in 1991, the Soviet ruble remained the currency of the Russian Federation until 1992. A new set of coins was issued in 1992 and a new set of banknotes was issued in the name of Bank of Russia in 1993. In September 1993 the Soviet ruble  was replaced with the Russian ruble at par. In 1998 preceding the financial crisis, the Russian ruble was redenominated with the new code "RUB" and was exchanged at the rate of 1,000 RUR = 1 RUB.', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (226, NULL, 'Soʻm', 'Uzbekistani soʻm', '1993-11-15', '1994-07-01', 310, 1000, 'In the Soviet Union, speakers of Kazakh, Kyrgyz and Uzbek called the ruble the som, and this name appeared written on the back of banknotes, among the texts for the value of the bill in all 15 official languages of the Union. The word "so''m" means "pure" in Kyrgyz, Uyghur and Uzbek. It implies "pure gold".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (201, 'руб', 'Ruble', 'Soviet ruble', '1961', '1993-09-01', 180, 1, 'The 1961 redenomination introduced 1 new ruble equal to 10 old rubles and restated all wages, prices and financial records into new rubles. It differed from the confiscatory nature of the 1947 reform when banknotes were reduced to 1/10th of its value but wages & prices remained the same. 
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (276, 'руб', 'Ruble', 'Soviet ruble', '1947-12-17', '1961', 201, 10, 'Following World War II, the Soviet government implemented a confiscatory redenomination of its currency (decreed on December 14th, 1947) to reduce the amount of money in circulation. The main purpose of this change was to prevent peasants, who had accumulated cash by selling food at wartime prices, from using this to buy consumer goods as the postwar recovery took hold. Old rubles were revalued at one tenth of their face value. Amounts of 3,000 rubles or less in individual bank accounts were not revalued, while salaries remained the same. Unlike other reforms, this one did not affect coins.', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (311, NULL, 'Ruble', '(Gold) Soviet ruble', '1924-03-07', '1947-12-17', 276, 10, 'After Joseph Stalin''s consolidation of power following the death of Lenin, he launched a third redenomination in 1924 by introducing the "gold" ruble at a value of 50,000 rubles of the previous issue. Under this reform the ruble was linked to the chervonets ("red gold") which put an end to chronic inflation.', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (312, NULL, 'Ruble', 'Soviet ruble', '1923-01-01', '1924-03-07', 311, 50000, 'A new redenomination took place in 1923, at a rate of 100 to 1. Again, only paper money was issued. During the lifetime of this currency, the first money of the Soviet Union was issued', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (313, NULL, 'Ruble', 'Soviet ruble', '1922-01-01', '1923-01-01', 312, 100, 'In 1922, the first of several redenominations took place, at a rate of 1 "new" ruble for 10,000 "old" rubles', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (206, NULL, 'Ruble', 'Tajikistani ruble', '1995-05-10', '2000-10-30', 207, 1000, 'Tajikistan continued using the Soviet and Russian rubles for a few years after independence. On 26 July 1993, when the new Russian ruble was issued, old Soviet rubles ceased to be legal tender in Russia. In Tajikistan, pre-1993 Soviet rubles ceased to be legal tender on 8 January 1994. On 10 May 1995, the Tajikistani ruble replaced the Russian ruble at a rate of 1 Tajikistani ruble to 100 Russian rubles.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (314, NULL, 'Cupon', 'Moldovan cupon', '1992', '1993', 134, 1000, 'The cupon was the temporary currency of Moldova between 1992 and 1993. It replaced the Soviet ruble at par and was replaced by the leu at a rate of 1 leu = 1000', 'Cupons');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (170, '₨', 'Rupee', 'Pakistani rupee', '1948', NULL, NULL, NULL, 'The Pakistani Rupee was put into circulation in Pakistan after the dissolution of the British Raj in 1947. Initially, Pakistan used British Indian coins and notes simply over-stamped with "Pakistan". New coins and banknotes were issued in 1948. Like the Indian rupee, it was originally divided into 16 annas, each of 4 pice or 12 pie. The currency was decimalised on 1 January 1961.', 'Rupees');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (113, 'C', 'Som', 'Kyrgyzstani som', '1993-05-10', NULL, NULL, NULL, 'In the Soviet Union, speakers of Kazakh, Kyrgyz and Uzbek called the ruble the som. The word som means "pure": it implies "pure gold".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (20, NULL, 'Manat', 'Azerbaijani manat', '1992-08-15', '2006-12-31', 21, 5000, 'The word manat is derived from the Latin word "Moneta".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (21, '₼', 'Manat', 'Azerbaijani manat', '2006-01-01', NULL, NULL, NULL, 'On 1 January 2006, a new manat was introduced at a ratio of 1 new manat to 5,000 old manat. The former manat remained valid through 31 December 2006.', 'Manat');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (316, NULL, 'Ruble', '(Second) Transcaucasian ruble', '1923', '1924', NULL, NULL, 'In 1923 and 1924, the Transcaucasian Soviet Federal Socialist Republic (part of the USSR) issued its own notes. In 1924 the Soviet ruble replaced it as the official currency of the Transcaucasian SFSR (and the three Soviet Socialist Republics that succeeded the Transcaucasian SFSR)', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (317, NULL, 'Ruble', '(First) Transcaucasian ruble', '1918', '1918', NULL, NULL, 'In 1918, the Comissariat of the short-lived Transcaucasian Democratic Federative Republic issued paper money denominated in rubles.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (315, NULL, 'Ruble', 'Armenian ruble', '1919', '1923', 316, 1, 'The ruble was the currency of the First Republic of Armenia and the Armenian Soviet Socialist Republic between 1919 and 1923. It replaced the first Transcaucasian ruble at par and was replaced by the second Transcaucasian ruble after Armenia became part of the Transcaucasian Soviet Federal Socialist Republic.', 'Rubles');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (7, '֏', 'Dram', 'Armenian dram', '1993-11-22', NULL, NULL, NULL, 'The word "dram" translates into English as "money" and is cognate with the Greek drachma and the Arabic dirham.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (318, NULL, 'Manat', 'Azerbaijani manat', '1919', '1923', 316, NULL, 'The Azerbaijan Democratic Republic and its successor the Azerbaijani Soviet Socialist Republic issued their own currency between 1919 and 1923. The currency was called the manat (منات) in Azerbaijani and the ruble (рубль) in Russian, with the denominations written in both languages (and sometimes also in French) on the banknotes.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (319, NULL, 'Maneti', 'Georgian maneti', '1919', '1923', 316, NULL, 'The maneti  was the currency of the Democratic Republic of Georgia and the Georgian Soviet Socialist Republic between 1919 and 1923. It replaced the first Transcaucasian ruble at par. It was replaced by the second Transcaucasian ruble after Georgia became part of the Transcaucasian Soviet Federal Socialist Republic.', 'Maneti');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (320, NULL, 'Kuponi', 'Georgian Kuponi', '1993-04-05', '1995-10-01', 80, 1e+06, 'Georgia replaced the Russian ruble on 5 April 1993, with the provisionaö Kuponi at par. This currency consisted only of banknotes, had no subdivisions and suffered from hyperinflation.', 'Kuponi');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (80, '₾', 'Lari', 'Georgian lari', '1995-10-02', NULL, NULL, NULL, 'The name lari is an old Georgian word denoting a hoard. It replaced the provisional coupon currency.', 'Lari');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (247, 'K', 'Kwacha', 'Zambian kwacha', '1968-01-16', '2013-06-01', 248, 1000, 'The name kwacha derives from the Nyanja, Bemba, and Tonga language word for "dawn", alluding to the Zambian nationalist slogan of a "new dawn of freedom".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (248, 'K', 'Kwacha', 'Zambian kwacha', '2013-01-01', NULL, NULL, NULL, 'The Bank of Zambia introduced on January 1, 2013 the new redenominated currency which became the legal tender of Zambia. The old and new currencies were allowed to circulate side-by-side for a transition period of six months, until 30 June 2013. During this period, the old currency was denoted by ''K'', whilst the new one was denoted by ''KR''. After the six-month period, the ''KR'' symbol was dropped, and the new currency was referred to by the ''K'' symbol.', 'Kwacha');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (321, '£', 'Pound', 'Zambian pound', '1964', '1968-01-15', 247, 0.5, 'The Zambian pound was the currency in Zambia from independence in 1964 until decimalization on January 16, 1968. It replaced  Rhodesia and Nyasaland pound at par.', 'Pounds');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (48, '$', 'Dollar', 'Canadian dollar', '1867', NULL, NULL, NULL, 'In 1857, it was decided to introduce a decimal coinage into the Province of Canada in conjunction with the U.S. dollar unit. Hence, when the new decimal coins were introduced in 1858, the colony''s currency became aligned with the U.S. currency, although the British gold sovereign continued to remain legal tender at the rate of £1 = ​4.86 2⁄3 right up until the 1990s.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (322, NULL, 'Peso', 'Honduran peso', '1862', '1931', 93, 1, 'The peso replaced the real at a rate of 1 peso = 8 reales. Initially, the peso was subdivided into 8 reales. In 1871, the currency was decimalized, with the peso subdivided into 100 centavos. The peso was replaced in 1931 by the lempira at par.', 'Pesos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (93, 'L', 'Lempira', 'Honduran lempira', '1931', NULL, NULL, NULL, 'The lempira was named after the 16th-century cacique Lempira, a ruler of the indigenous Lenca people, who is renowned in Honduran folklore for leading the (ultimately unsuccessful) local native resistance against the Spanish forces.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (323, '₩', 'Won', 'North Korean won', '1959', '2009-11-30', 324, 100, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (324, '₩', 'Won', 'North Korean won', '2009-12-07', NULL, NULL, NULL, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (116, '₩', 'Won', 'North Korean won', '1947-12-06', '1959', 323, 100, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (16, '$', 'Peso', 'Argentine peso', '1992-01-01', NULL, NULL, NULL, 'The peso  replaced the austral at a rate of 1 peso = 10,000 australes. It was also referred to as peso convertible since the international exchange rate was fixed by the Central Bank at 1 peso to 1 U.S. dollar and for every peso convertible circulating, there was a US dollar in the Central Bank''s foreign currency reserves.', 'Pesos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (117, NULL, 'Won', NULL, '0', NULL, NULL, NULL, 'Won is a cognate of the Chinese yuan and Japanese yen. All three names derive from a Hanja word which means "round shape".', 'Won');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (215, 'TT$', 'Dollar', 'Trinidad and Tobago dollar', '1964', NULL, NULL, NULL, 'In 1964, Trinidad and Tobago introduced its own dollar, 2 years after its independency.', 'Dollars');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (14, '$L', 'Peso', 'Argentine peso ley', '1970-01-01', '1983-05-05', 15, 10000, 'The peso ley replaced the peso moneda nacional at a rate of 100 to 1.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (325, '$m/n', 'Peso', 'Argentine peso moneda nacional', '1881-11-05', '1970-01-01', 14, 100, 'The peso moneda nacional replaced the Argentine real at a rate of one to eight. It also replaced the peso fuerte at par and the peso moneda corriente at a rate of 25 pesos moneda corriente = 1 peso moneda nacional. ', 'Pesos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (208, 'T', 'Manat', 'Turkmenistan manat', '1993-11-01', '2008-12-31', 209, 5000, 'The manat was introduced on 1 November 1993, replacing the Russian ruble at a rate of 1 manat = 500 rubles.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (15, '$a', 'Peso argentino', 'Argentine peso', '1983-06-06', '1985-06-14', 13, 1000, 'The peso argentino replaced the peso ley at a rate of 1 peso argentino = 10,000 pesos ley', 'Pesos Argentinos');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (326, '$', 'Real', 'Argentine real', '1813', '1881', 325, 8, 'In 1813 Argentina began issuing its own coins. From 1820, paper money was also issued. From 1822, it was subdivided into 10 décimos. The sol was also issued during this period and was equal to the real, whilst the peso was worth 8 reales and the escudo was worth 16 reales.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (129, 'Ls', 'Lats', 'Latvian lats', '1993-03-05', '2014-01-14', 74, 0.702804, 'The lats was reintroduced on 5 March 1993, replacing the Latvian rublis, which continued to circulate and kept validity until and including 30 June 1994 at a rate of 200 rubļu to 1 lats. The lats was replaced on 1 January 2014 by the Euro.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (327, 'Lvr', 'Rublis', 'Latvian rublis', '1992-05-07', '1993-10-18', 129, 200, 'From 7 May 1992, a temporary currency, the Latvian rublis (LVR), was put into circulation as a legal tender parallel to the existing ruble notes. It was declared equal in value to the Soviet ruble. The Latvian rublis notes were widely known as repšiki, after the then governor of the Central Bank, Einars Repše.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (328, NULL, 'Rublis', 'Latvian rublis', '1919-02-04', '1922', 329, 50, 'After the proclamation of the Republic of Latvia in 1918, a great variety of different currencies were in circulation: ostrubles, ostmarks, German Papiermark, the so-called Tsar rubles, kopecks, the so-called Duma Money and kerenkas, as well as promissory notes issued by several town municipalities.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (127, 'Lt', 'Litas', 'Lithuanian litas', '1993-06-25', '2015-01-01', 74, 3.4528, 'The litas was first introduced after World War I, when Lithuania declared independence. It was reintroduced on 25 June 1993, following a period of currency exchange from the ruble to the litas with the temporary talonas also in place. The name was modeled after the name of the country (similar to Latvia and its lats).
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (330, NULL, 'Talonas', 'Lithuanian talonas', '1991-08-05', '1993-06-25', 127, 100, 'The talonas was a temporary currency issued in Lithuania between 1991 and 1993. It replaced the Soviet ruble at par and was replaced by the litas at a rate of 100 talonas = 1 litas. The talonas was only issued as paper money.', 'Talonas');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (329, NULL, 'Lats', 'Latvian lats', '1922-08-03', '1940', NULL, NULL, 'The lats was first introduced on 3 August 1922, replacing the Latvian rublis at a rate of 1 lats = 50 rubļi. The lats was pegged against the gold standard from its introduction till 1940.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (331, NULL, 'Litas', 'Lithuanian litas', '1922-10-02', '1941', NULL, NULL, 'The first litas was introduced on 2 October 1922, replacing the ostmark and ostruble, both of which had been issued by the occupying German forces during World War I.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (69, 'kr', 'Kroon', 'Estonian kroon', '1992-06-20', '2011-01-15', 74, 15.64664, 'The kroon was reintroduced as Estonia''s currency on 20 June 1992, replacing the Soviet ruble at a rate of 1 kroon = 10 rubles. Each person was able to change a maximum of 1500 rubles to 150 krooni.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (334, NULL, 'Kroon', 'Estonian kroon', '1928-09-01', '1940', NULL, NULL, 'The kroon became the currency of Estonia on 1 September 1928 after having been a unit of account since 1924. It replaced the mark at a rate of 100 mark = 1 kroon. It  circulated until the Soviet occupation of 1940. The kroon was exchanged for the Soviet ruble at a rate of 1 ruble = 0.8 kroon.', 'Krooni');
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (335, NULL, 'Mark', 'Estonian mark', '1918', '1928', 334, 100, 'The Estonian mark was the currency of Estonia between 1918 and 1927. Until 1919 there were also Russian rubles, German ostrubles and Finnish marks in circulation.
INSERT INTO public.cur_currency (cur_id, cur_symbol, cur_name, cur_full_name, cur_start, cur_end, cur_successor, cur_replacement_rate, cur_description, cur_name_plural) VALUES (336, 'BWI$', 'BWI Dollar', 'British West Indies dollar', '1949', '1965', 235, 1, 'The British West Indies dollar (BWI$) was the currency of British Guiana and the Eastern Caribbean territories of the British West Indies from 1949 to 1965, when it was largely replaced by the East Caribbean dollar and the Trinidad and Tobago dollar. It was also one of the currencies used in Jamaica from 1954 to 1964.', 'Dollars');
