INSERT INTO public.ser_series (ser_id, ser_cur_id, ser_name, ser_start, ser_end, ser_iss_id, ser_law_date, ser_description, ser_is_overstamped) VALUES (20, 72, 'Spanish State, Burgos 1st issue', 1936, 1936, 1, NULL, 'Issued by the Nationalist party at the beginning of the Civil War. Banknotes were printed with the name of the Nationalist provisional capital, Burgos. Since BWC declined to provide banknotes for the Nationalist party, this issue was printed by the German company Giesecke & Devrient. This issue replaced the overstamped republican banknotes on May 15, 1937. On April 29, banknotes of smaller denominations were commisioned to a printing company in Zaragoza, due to the scarcity of coins. This company, "Portabella", used paper and dyes from the German printer G&D. ', 0);
