INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (285, 4, 3, 'ZR', 'ZAR', 'Zaire', 'Republic of Zaire', 1971, 1997, NULL, '288', 'Congo achieved independence from Belgium on 30 June 1960 under the name Republic of the Congo. In 1971, the country was renamed as Zaire, under the rule of self Mobutu Sese Seko, On 17 May 1997, the country''s name was reverted to the Democratic Republic of the Congo');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (327, 2, 5, NULL, NULL, 'Belize, UK', 'Belize / British Honduras (1862–1973)', 1862, 1981, 224, '22', 'British Honduras was a British Crown colony on the east coast of Central America, south of Mexico, from 1862 to 1964, then a self-governing colony, renamed Belize in June 1973, until September 1981, when it gained full independence as Belize.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (329, 5, 5, NULL, NULL, 'Brunei, UK', 'British protectorate of Brunei', 1888, 1984, 224, '32', NULL);
