INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (50, 4, 3, NULL, NULL, 'Congo-Kinshasa', 'Democratic Republic of the Congo', 1960, 1971, NULL, '285', 'Between 1960 and 1964 the official name of the country was Republic of the Congo. Therefore, to avoid confusion with the neighboring country with the same name, it was also known as Congo-Kinshasa ');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (110, 5, 3, 'KZ', 'KAZ', 'Kazakhstan', 'Republic of Kazakhstan', 1991, NULL, NULL, NULL, 'In the 18th century the Russians began advancing into the Kazakh steppe and by the mid-19th century, they nominally ruled all of Kazakhstan as part of the Russian Empire. Following the 1917 Russian Revolution, and subsequent civil war, the territory of Kazakhstan was reorganised several times. In 1936, it was made the Kazakh Soviet Socialist Republic, part of the Soviet Union. Kazakhstan was the last of the Soviet republics to declare independence during the dissolution of the Soviet Union in 1991.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (199, 6, 3, 'ES', 'ESP', 'Spain', 'Kingdom of Spain', 1479, NULL, NULL, NULL, 'Spain was united as a Kingdom in 1479, after Isabella I of Castile  and Ferdinand II of Aragon, who married in 1469, were crowned as Queen of Castile (in 1474) and King of Aragon (on January 29, 1479). Afterwards the Muslim kingdom of Granada as well as the Canary Islands were  conquered in 1492. Finally the Kingdom of Navarre was annexed in 1512, completing the current extent of Spain, except for small changes like the lost of Gibraltar (conquered by the United Kingdom in 1704) , the cession of Ceuta by Portugal (1668) or the annexation of the town of Olivenza (1801).<br>Between 1581 and 1640 Spain and Portugal formed a dynastic union, the so called Iberian Union, but the 2 countries were not formally merged. <br>
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (68, 6, 3, 'EE', 'EST', 'Estonia', 'Republic of Estonia', 1991, NULL, NULL, NULL, 'Estonia was an independent state between 1920 and 1940. In 1940 Estonia was occupied by the Soviet Union and incorporated as a SSR. In 1987 the peaceful Singing Revolution began against Soviet rule, resulting in the restoration of de facto independence on 20 August 1991.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (284, 6, 3, 'YU', 'YUG', 'Yugoslavia', 'Socialist Federal Republic of Yugoslavia', 1918, 1992, NULL, '193,54,125,27,275', 'Yugoslavia was founded in 1918 under the name of the <b>Kingdom of Serbs, Croats and Slovenes</b> by the merger of the provisional State of Slovenes, Croats and Serbs 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (369, 5, 3, NULL, NULL, 'Armenia', 'Armenian Soviet Socialist Republic', 1918, 1922, NULL, '370', 'The Armenian National Council declared the independence of Armenia on 28 May 1918, as the Republic of Armenia. The republic lasted for over two years, during which time it was involved in several armed conflicts caused by territorial disputes. By late 1920, the nation was conquered by the Soviet Red Army. The First Republic, along with the Republic of Mountainous Armenia which repelled the Soviet invasion until July 1921, was superseded by the Armenian Soviet Socialist Republic that became part of the Soviet Union in 1922.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (354, 5, 5, NULL, NULL, 'Philippines, Spain', 'Captaincy General of the Philippines', 1565, 1898, 199, '355', 'The Captaincy General encompassed the Spanish East Indies,  which besides the Philippine islands included the Marianas, Carolines, Palaos and Guam, as well as parts of Formosa (Taiwan), Sulawesi (Celebes) and the Moluccas (Maluku)');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (355, 5, 5, NULL, NULL, 'Philippines, US', 'Commonwealth of the Philippines', 1898, 1946, 225, '169', NULL);
