INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (359, 4, 5, NULL, NULL, 'Spanish Guinea', 'Province of the Gulf of Guinea', 1778, 1968, 199, '66', NULL);
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (87, 2, 5, 'GP', 'GLP', 'Guadeloupe', 'Overseas department of Guadelope', 1946, NULL, 74, NULL, 'In 1946, the colony of Guadeloupe became an overseas department of France. Through a referendum in 2003, Saint-Martin and Saint Barthélemy voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (254, 2, 5, 'BL', 'BLM', 'Saint Barthélemy', 'Territorial Collectivity of Saint-Barthélemy', 2007, NULL, 74, NULL, 'Through a referendum in 2003, Saint Barthélemy voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (260, 2, 5, 'MF', 'MAF', 'Saint Martin ', 'Collectivity of Saint Martin', 2007, NULL, 74, NULL, 'Through a referendum in 2003, Saint-Martin  voted to separate from the administrative jurisdiction of Guadeloupe, this being fully enacted by 2007.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (360, 6, 3, NULL, NULL, 'Serbia, Kingdom', 'Kingdom of Serbia', 1867, 1918, NULL, '284', 'The Kingdom of Serbia was created when the ruler of the Principality of Serbia, Milan I was proclaimed king in 1882.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (62, 5, 3, 'TL', 'TLS', 'Timor-Leste', 'Democratic Republic of Timor-Leste', 2002, NULL, NULL, NULL, 'East Timor was colonised by Portugal in the 16th century and was known as Portuguese Timor until 28 November 1975, when the Revolutionary Front for an Independent East Timor (Fretilin) declared the territory''s independence. Nine days later, it was invaded and occupied by the Indonesian military; it was declared Indonesia''s 27th province the following year. 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (297, 5, 5, 'TP', 'TMP', 'Portuguese Timor', 'East Timor', 1702, 1975, 172, '265', 'From 1702 to 1975, East Timor was an overseas territory of Portugal named "Portuguese Timor". In 1974, Portugal initiated a gradual decolonization process of its remaining overseas territories, including Portuguese Timor. During the process, a civil conflict between the different Timorese parties erupted. In 1975, Indonesia invaded East Timor and in 1976, it formally annexed the territory.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (265, 5, 5, 'TP', NULL, 'East Timor', 'East Timor', 1976, 2002, 101, '62', 'In 1975, Indonesia invaded East Timor and in 1976, it formally annexed the territory, declaring it as its 27th province and renaming it Timor Timur. In 1999, following the United Nations-sponsored act of self-determination, Indonesia relinquished control of the territory. As "Timor-Leste", it became a sovereign state on 20 May 2002 and joined the United Nations.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (124, 5, 5, 'MO', 'MAC', 'Macao', 'Macao Special Administrative Region of the People''s Republic of China', 1999, NULL, 44, NULL, 'Macao (or Macau) was a former colony of the Portuguese Empire, after Ming China leased the territory as a trading post in 1557. Portugal paid an annual rent and administered the territory under Chinese sovereignty until 1887 when it gained perpetual colonial rights in the Sino-Portuguese Treaty of Peking. The colony remained under Portuguese rule until 1999, when it was transferred to China.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (362, 5, 5, NULL, NULL, 'Portuguese Macao', 'Overseas Province of Macao', 1557, 1999, 172, '124', 'In 1557, Portugal had established a permanent settlement in Macao, paying an annual ground rent of 500 taels. By 1583, the enclave had a municipal government with a Senate Council.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (97, 5, 5, 'HK', 'HKG', 'Hong Kong', 'Hong Kong Special Administrative Region of the People''s Republic of China', 1997, NULL, 44, NULL, 'Hong Kong became a colony of the British Empire after the Qing Empire ceded Hong Kong Island at the end of the First Opium War in 1842. The colony expanded to the Kowloon Peninsula in 1860 after the Second Opium War and was further extended when Britain obtained a 99-year lease of the New Territories in 1898.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (363, 5, 5, NULL, NULL, 'British Hong Kong', 'British Dependent Territory of Hong Kong', 1842, 1997, 224, '97', 'British Hong Kong was a colony and dependent territory of the United Kingdom from 1841 to 1997, apart from a brief period under Japanese occupation from 1941 to 1945. The colonial period began with the occupation of Hong Kong Island in 1841 during the First Opium War. The island was ceded by Qing Empire in the aftermath of the war in 1842 and established as a Crown colony in 1843. The colony expanded to the Kowloon Peninsula in 1860 after the Second Opium War and was further extended when the UK obtained a 99-year lease of the New Territories in 1898.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (288, 4, 3, 'CD', 'COD', 'Congo, Democratic Republic', 'Democratic Republic of the Congo', 1997, NULL, NULL, NULL, 'The Democratic Republic of the Congo (DRC), also known as DR Congo, Congo-Kinshasa, the DROC, the Congo and historically Zaire, is a country in Central Africa.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (163, 7, 3, 'PW', 'PLW', 'Palau', 'Republic of Palau', 1994, NULL, NULL, NULL, 'Palau (historically Belau, Palaos or Pelew) is an island country located in the western Pacific Ocean. The country contains approximately 340 islands, and together with parts of the Federated States of Micronesia, forms the western chain of the Caroline Islands.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (244, 4, 2, NULL, NULL, 'West African Union', 'West African Economic and Monetary Union', 1994, NULL, NULL, NULL, 'The West African Economic and Monetary Union (also known as UEMOA from its name in French, Union économique et monétaire ouest-africaine) is an organisation of eight, mainly francophone West African states within the ECOWAS. It was established to promote economic integration among countries that share the CFA franc as a common currency. UEMOA was created by a Treaty signed at Dakar, Senegal, on 10 January 1994, by the governments of Benin, Burkina Faso, Côte d''Ivoire, Mali, Niger, Senegal, and Togo. On 2 May 1997, Guinea-Bissau, a former Portuguese colony, became the organisation''s eighth (and only non-francophone) member state.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (263, 6, 3, 'CS', 'CSK', 'Czechoslovakia', 'Czechoslovak Socialist Republic', 1918, 1992, NULL, '57,192', 'Czechoslovakia, or Czecho-Slovakia, was founded in October 1918, when it declared its independence from the Austro-Hungarian Empire. It existed until its peaceful dissolution into the Czech Republic and Slovakia on 1 January 1993.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (57, 6, 3, 'CZ', 'CZE', 'Czech Republic', 'Czech Republic', 1993, NULL, NULL, NULL, 'The Czech Republic, also known by its short-form name, Czechia, was founded on 1 January 1993 when Czechoslovakia was split into its constituent states, the Czech Republic and Slovakia.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (67, 4, 3, 'ER', 'ERI', 'Eritrea', 'State of Eritrea', 1993, NULL, NULL, NULL, 'The Eritrean War of Independence started in 1962 and went on for 30 years against successive Ethiopian governments until 1991, when the Eritrean People''s Liberation Front (EPLF) defeated the Ethiopian forces in Eritrea.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (280, 6, 3, 'SU', 'SUN', 'Soviet Union', 'Union of Soviet Socialist Republics', 1922, 1991, NULL, '177,228,222,218,110,68,116,122,209,139,80,20,11,15,114', 'The Soviet Union was the union of multiple national Soviet republics. It was a one-party state (until 1990) governed by the Communist Party, with Moscow as its capital in its largest republic, the Russian SFSR.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (371, 5, 3, NULL, NULL, 'Transcaucasian Federation', 'Transcaucasian Democratic Federative Republic', 1918, 1918, NULL, '369,372,373', 'An independent state was proclaimed on 22 April as the TDFR.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (372, 5, 3, NULL, NULL, 'Azerbaijan ', 'Azerbaijan Soviet Socialist Republic', 1918, 1922, NULL, '370', 'The Azerbaijan Democratic Republic was founded by the Azerbaijani National Council in Tiflis on 28 May 1918 after the collapse of the Russian Empire. The Azerbaijan Democratic Republic was occupied on 28 April 1920 by the Soviet red Army and it became the Azerbaijan Soviet Socialist Republic. In December 1922, the Transcaucasian SFSR became part of the newly established Soviet Union, incorporating the Azerbaijan SSR,  along with the Armenian SSR and the Georgian SSR.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (275, 6, 3, 'CS', 'CSG', 'Yugoslavia / Serbia and Montenegro', 'Federal Republic of Yugoslavia / State Union of Serbia and Montenegro', 1992, 2006, NULL, '250,248', 'After the disolution of the Socialist Federal Republic of Yugoslavia after its breakup in 1992, the republics of Montenegro and Serbia formed a reduced federative state, known officially until 2003 as the </b>Federal Republic of Yugoslavia</b>.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (27, 6, 3, 'BA', 'BIH', 'Bosnia and Herzegovina', 'Bosnia and Herzegovina', 1992, NULL, NULL, NULL, 'Bosnia and Herzegovina was part of the Kingdom of Yugoslavia and after World War II, it was granted full republic status in the newly formed Socialist Federal Republic of Yugoslavia. Following the dissolution of Yugoslavia, the republic proclaimed independence in 1992, which was followed by the Bosnian War, lasting until late 1995 with the Dayton Agreement');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (125, 6, 3, 'MK', 'MKD', 'Macedonia, North', 'Republic of North Macedonia', 1991, NULL, NULL, NULL, 'It was a constituent state of communist Yugoslavia until its peaceful secession on  8 September 1991. The country became a member of the United Nations in April 1993, but as a result of a dispute with Greece over the name "Macedonia", it was admitted under the provisional description "the former Yugoslav Republic of Macedonia"(abbreviated as "FYR Macedonia" or "FYROM"). In June 2018, Macedonia and Greece resolved the dispute with an agreement that the country should rename itself "Republic of North Macedonia". This renaming came into effect in February 2019.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (364, 6, 4, NULL, NULL, 'Republic of Srpska', 'Republic of Srpska', 1992, 1995, 27, '27', 'The Republika Srpska was a proto-state  under the control of the Army of Republika Srpska during the Bosnian War. It claimed to be a sovereign state, though this claim was not recognized by the Bosnian government, the United Nations, or any other recognized state. For the first few months of its existence, it was known as the Serbian Republic of Bosnia and Herzegovina.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (365, 6, 4, NULL, NULL, 'Krajina', 'Republic of Serbian Krajina', 1991, 1995, 54, '54', 'The Republic of Serbian Krajina, known as the Serbian Krajina or simply Krajina, was a self-proclaimed Serb proto-state, a territory within the newly independent Croatia (formerly part of Yugoslavia), which it defied, and which was active during the Croatian War (1991–95). It was not recognized internationally. The name Krajina ("Frontier") was adopted from the historical Military Frontier of the Habsburg Monarchy and Austria-Hungary.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (366, 6, 4, NULL, NULL, 'Serbia, Germany', 'Territory of the Military Commander in Serbia', 1941, 1944, 284, '284', 'This was the area of the Kingdom of Yugoslavia that was placed under a military government of occupation by the Wehrmacht following the invasion, occupation and dismantling of Yugoslavia in April 1941. The territory included only central Serbia, with the addition of the northern part of Kosovo (around Kosovska Mitrovica), and the Banat.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (361, 6, 4, NULL, NULL, 'Croatia, Germany', 'Independent State of Croatia', 1941, 1945, 284, '284', 'The Independent State of Croatia was a World War II-era puppet state of Nazi Germany and Fascist Italy');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (331, 5, 5, NULL, NULL, 'Malaya, UK', 'Federation of Malaya', 1948, 1957, 224, '330', 'Federation of British Malaya, comprising eleven states (nine Malay states and two of the British Straits Settlements, Penang and Malacca) that existed from 1 February 1948 until 16 September 1963. The Federation became independent on 31 August 1957.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (334, 5, 5, NULL, NULL, 'Singapore, UK', 'Colony of Singapore', 1946, 1963, 224, '128', 'The Colony of Singapore was a British Crown colony that existed from 1946 until 1963. In 1946, the Straits Settlements were dissolved and Singapore together with the Cocos-Keeling and Christmas Island became a separate Crown colony. The colony was governed by the United Kingdom until it gained partial internal self-governance in 1955. The Crown colony was dissolved on 16 September 1963 when Singapore became a state of Malaysia. On 9 August 1965, Singapore officially left Malaysia to become the independent Republic of Singapore');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (14, 6, 3, 'AT', 'AUT', 'Austria', 'Republic of Austria', 1918, NULL, NULL, NULL, 'After the defeat and the dissolution of the Austria-Hungary Monarchy, the Republic of German-Austria was proclaimed with the intent of the union with Germany, which eventually failed because of the Allied Powers and the state remained unrecognized. In 1919 the First Austrian Republic became the legal successor of Austria. In 1938, the Austrian-born Adolf Hitler, achieved the annexation of Austria by the "Anschluss". Following the defeat of Nazi Germany in 1945 and an extended period of Allied occupation, Austria was re-established as a sovereign and self-governing democratic nation known as the Second Republic.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (367, 6, 3, NULL, NULL, 'Austria-Hungary', 'Austro-Hungarian Monarchy', 1867, 1918, NULL, '14,98,263,284', 'Austria-Hungary, the Austro-Hungarian Empire or the Dual Monarchy, was a constitutional monarchy and great power in Central Europe between 1867 and 1918. It was formed with the Austro-Hungarian Compromise on 30 March 1867 in the aftermath of the Austro-Prussian War. It consisted of two monarchies (Austria and Hungary), and one autonomous region: the Kingdom of Croatia-Slavonia under the Hungarian crown. After 1878, Bosnia and Herzegovina came under Austro-Hungarian military and civilian rule until it was fully annexed in 1908.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (98, 6, 3, 'HU', 'HUN', 'Hungary', 'Republic of Hungary', 1918, NULL, NULL, NULL, 'The Austro-Hungarian Empire collapsed after World War I, and the subsequent Treaty of Trianon established Hungary''s current borders, resulting in the loss of 71% of its territory, 58% of its population, and 32% of ethnic Hungarians. 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (6, 4, 3, 'AO', 'AGO', 'Angola', 'Republic of Angola', 1975, NULL, NULL, NULL, 'After a anti-colonial struggle, independence was achieved in 1975 as the Marxist–Leninist People''s Republic of Angola, a one-party state supported by the Soviet Union and Cuba. A civil war was started with the support to the opposing movement from the US and South Africa.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (368, 4, 5, NULL, NULL, 'Portuguese Angola', 'Province of Angola / State of Angola', 1648, 1975, 172, '6', 'In 1575, the settlement of Luanda was established on the coast south of the Kongo Kingdom, and in the 17th century the settlement of Benguela, even farther to the south. During the Portuguese war of independence against the Spanish, the Dutch ruled Luanda from 1640 to 1648.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (217, 5, 3, 'TR', 'TUR', 'Turkey', 'Republic of Turkey', 1923, NULL, NULL, NULL, 'After the Ottomans and the other Central Powers lost World War I, the territories and peoples that had composed the Ottoman Empire were partitioned into several new states.[The Turkish War of Independence, initiated by Mustafa Kemal Atatürk against the occupying Allied Powers, resulted in the abolition of the sultanate on 1 November 1922, the replacement of the Treaty of Sèvres (1920) with the Treaty of Lausanne (1923), and the establishment of the Republic of Turkey on 29 October 1923, with Atatürk as its first president.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (103, 5, 3, 'IQ', 'IRQ', 'Iraq', 'Republic of Iraq', 1932, NULL, NULL, NULL, 'The country today known as Iraq was a region of the Ottoman Empire until the partition of the Ottoman Empire in the 20th century. It was made up of three provinces, called vilayets in the Ottoman Turkish language: Mosul Vilayet, Baghdad Vilayet, and Basra Vilayet. In April 1920 the British Mandate of Mesopotamia was created under the authority of the League of Nations. A British-backed monarchy joining these vilayets into one Kingdom was established in 1921 under Faisal I of Iraq. The Hashemite Kingdom of Iraq gained independence from the UK in 1932. In 1958, the monarchy was overthrown and the Iraqi Republic created. Iraq was controlled by the Arab Socialist Ba''ath Party from 1968 until 2003.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (1, 5, 3, 'AF', 'AFG', 'Afghanistan', 'Islamic Republic of Afghanistan', 1919, NULL, NULL, NULL, 'In the First Anglo-Afghan War, the British East India Company seized control of Afghanistan briefly, but following the Third Anglo-Afghan War in 1919 the country became a monarchy under Amanullah Khan. Almost 50 years later the last king was overthrown and a republic was established. In 1978, after a second coup, Afghanistan first became a socialist state and then a Soviet protectorate, evoking the Soviet–Afghan War in the 1980s against mujahideen rebels. By 1996, most of the country was captured by the Islamic fundamentalist Taliban, who ruled as a totalitarian regime for over five years; they were removed from power after the US invasion in 2001 but still control a significant portion of the country. ');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (102, 5, 3, 'IR', 'IRN', 'Iran', 'Islamic Republic of Iran', -247, NULL, NULL, NULL, 'Iran, also known as Persia, is home to one of the world''s oldest civilizations, beginning with the formation of the Elamite kingdoms in the fourth millennium BC. It was first unified by the Iranian Medes in the seventh century BC and reached its territorial height in the sixth century BC, when Cyrus the Great founded the Achaemenid Empire, which stretched from Eastern Europe to the Indus River, making it one of the largest empires in history. The empire fell to Alexander the Great in the fourth century BC and was divided into several Hellenistic states. An Iranian rebellion established the Parthian Empire in the third century BC, which was succeeded in the third century AD by the Sasanian Empire, a major world power for the next four centuries. 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (141, 5, 3, 'MN', 'MNG', 'Mongolia', 'Mongolia', 1921, NULL, NULL, NULL, 'After the collapse of the Qing dynasty in 1911, Mongolia declared independence, and achieved actual independence from the Republic of China in 1921. Shortly thereafter, the country came under the control of the Soviet Union, which had aided its independence from China. In 1924, the Mongolian People''s Republic was founded as a socialist state. After the anti-Communist revolutions of 1989, Mongolia conducted its own peaceful democratic revolution in early 1990. This led to a multi-party system, a new constitution of 1992, and transition to a market economy.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (209, 5, 3, 'TJ', 'TJK', 'Tajikistan', 'Republic of Tajikistan', 1991, NULL, NULL, NULL, 'The region was conquered in the 19th century by the Russian Empire and subsequently by the Soviet Union. Within the Soviet Union, the country''s modern borders were drawn when it was part of Uzbekistan as an autonomous republic before becoming a full-fledged Soviet republic in 1929.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (139, 6, 3, 'MD', 'MDA', 'Moldova', 'Republic of Moldova', 1991, NULL, NULL, NULL, 'In 1812 the Principality of Moldavia was ceded to the Russian Empire by the Ottoman Empire and became known as Bessarabia. In 1856, southern Bessarabia was returned to Moldavia, which three years later united with Wallachia to form Romania, but Russian rule was restored over the whole of the region in 1878. During the 1917 Russian Revolution, Bessarabia briefly became an autonomous state within the Russian Republic, known as the Moldavian Democratic Republic. In February 1918, the Moldavian Democratic Republic declared independence and then integrated into Romania later that year following a vote of its assembly. The decision was disputed by Soviet Russia, which in 1924 established, within the Ukrainian SSR, a Moldavian autonomous republic on partially Moldovan-inhabited territories to the east of Bessarabia.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (25, 5, 3, 'BT', 'BTN', 'Bhutan', 'Kingdom of Bhutan', 1634, NULL, NULL, NULL, 'The historical origins of Bhutan are unclear. Until the early 17th century, Bhutan existed as a patchwork of minor warring fiefdoms, when the area was unified by the Tibetan lama and military leader Ngawang Namgyal.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (114, 5, 3, 'KG', 'KGZ', 'Kyrgyzstan', 'Kyrgyz Republic', 1991, NULL, NULL, NULL, 'Inhabited by a succession of tribes and clans, Kyrgyzstan has periodically fallen under domination of different kingdoms and empires . In 1876, it became part of the Russian Empire, remaining in the USSR as the Kirghiz Soviet Socialist Republic after the Russian Revolution. Following the democratic reforms in the USSR, in 1990 pro-independence candidate Askar Akayev was elected president. On 31 August 1991, Kyrgyzstan declared independence from Moscow and a democratic government was established. ');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (11, 5, 3, 'AM', 'ARM', 'Armenia', 'Republic of Armenia', 1991, NULL, NULL, NULL, 'In 1918, following the Russian Revolution, all non-Russian countries declared their independence after the Russian Empire ceased to exist, leading to the establishment of the First Republic of Armenia. By 1920, the state was incorporated into the Transcaucasian Socialist Federative Soviet Republic, and in 1922 became a founding member of the Soviet Union. In 1936, the Transcaucasian state was dissolved, transforming its constituent states, including the Armenian Soviet Socialist Republic, into full Union republics. The modern Republic of Armenia became independent in 1991 during the dissolution of the Soviet Union.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (80, 5, 3, 'GE', 'GEO', 'Georgia', 'Georgia', 1991, NULL, NULL, NULL, 'During the Civil War following the Russian Revolution in 1917, Georgia briefly became part of the Transcaucasian Federation and then emerged as an independent republic before the Russian army invasion in 1921. Soviet Georgia was incorporated into a new Transcaucasian Federation and became a founding republic of the Soviet Union in 1922. In 1936, the Transcaucasian Federation was dissolved and Georgia emerged as a Union Republic.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (373, 5, 3, NULL, NULL, 'Georgia', 'Georgian Soviet Socialist Republic', 1918, 1922, NULL, '370', 'The Democratic Republic of Georgia existed from May 26, 1918 to February 1921 and was the first modern establishment of a republic of Georgia.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (237, 4, 3, 'ZM', 'ZMB', 'Zambia', 'Republic of Zambia', 1964, NULL, NULL, NULL, 'Originally inhabited by Khoisan peoples, the region was affected by the Bantu expansion of the thirteenth century. The British colonised the region into the British protectorates of Barotziland-North-Western Rhodesia and North-Eastern Rhodesia towards the end of the nineteenth century. These were merged in 1911 to form Northern Rhodesia. 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (96, 2, 3, 'HN', 'HND', 'Honduras', 'Republic of Honduras', 1838, NULL, NULL, NULL, 'Honduras was colonized by Spain in the 16th century. It became independent in 1821 and has since been a republic. It has endured much social strife and political instability, and remains one of the poorest countries in the Western Hemisphere. In 1960, the northern part of what was the Mosquito Coast was transferred from Nicaragua to Honduras by the International Court of Justice.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (158, 5, 3, 'KP', 'PRK', 'Korea, North', 'Democratic People''s Republic of Korea', 1948, NULL, NULL, NULL, 'In 1910, Korea was annexed by Imperial Japan. At the Japanese surrender at the end of World War II in 1945, Korea was divided into two zones, with the north occupied by the Soviet Union and the south occupied by the United States. Negotiations on reunification failed, and in 1948, separate governments were formed: the socialist Democratic People''s Republic of Korea in the north, and the capitalist Republic of Korea in the south.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (38, 2, 3, 'CA', 'CAN', 'Canada', 'Canada', 1867, NULL, NULL, NULL, 'Beginning in the 16th century, British and French expeditions explored and later settled along the Atlantic coast. As a consequence of various armed conflicts, France ceded nearly all of its colonies in North America in 1763. In 1867, with the union of three British North American colonies through Confederation, Canada was formed as a federal dominion of four provinces. This began an accretion of provinces and territories and a process of increasing autonomy from the United Kingdom. This widening autonomy was highlighted by the Statute of Westminster 1931 and culminated in the Canada Act 1982, which severed the vestiges of legal dependence on the British Parliament.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (10, 3, 3, 'AR', 'ARG', 'Argentina', 'Argentine Republic', 1816, NULL, NULL, NULL, 'The country has its roots in Spanish colonization of the region during the 16th century. Argentina rose as the successor state of the Viceroyalty of the Río de la Plata, a Spanish overseas viceroyalty founded in 1776. The declaration for independence (9 July 1816) was followed by an extended civil war that lasted until 1861, culminating in the country''s reorganization as a federation of provinces with Buenos Aires as its capital city.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (291, 5, 4, NULL, NULL, 'Artsakh', 'Republic of Artsakh / Nagorno-Karabakh Republic', 1991, NULL, 15, NULL, 'The predominantly Armenian-populated region of Nagorno-Karabakh was claimed by both the Azerbaijan Democratic Republic and the First Republic of Armenia when both countries became independent in 1918 after the fall of the Russian Empire, and a brief war over the region broke out in 1920. The dispute was largely shelved after the Soviet Union established control over the area, and created the Nagorno-Karabakh Autonomous Oblast (NKAO) within the Azerbaijan SSR in 1923. During the fall of the Soviet Union, the region re-emerged as a source of dispute between Armenia and Azerbaijan. In 1991, a referendum held in the NKAO and the neighbouring Shahumian region resulted in a declaration of independence. Ethnic conflict led to the 1991–1994 Nagorno-Karabakh War. Conflict has sporadically broken out since then.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (370, 5, 5, NULL, NULL, 'Transcaucasian Soviet Republic', 'Transcaucasian Socialist Federative Soviet Republic', 1922, 1936, 280, '280', 'The TSFSR comprised Armenia, Azerbaijan and Georgia, traditionally known as the "Transcaucasian Republics" as they were separated from Russia by the Caucasus Mountains. It was a republic of the Soviet Union  from 1922 to 1936. The TSFSR was dissolved upon the adoption of the 1936 Soviet Constitution and its constituent republics were elevated individually to republics of the Soviet Union.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (116, 6, 3, 'LV', 'LVA', 'Latvia', 'Republic of Latvia', 1990, NULL, NULL, NULL, 'Latvia had been an independent state between 1918 and 1940, when it was incorporated into the Soviet Union. 
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (374, 6, 3, NULL, NULL, 'Estonia', 'Estonia', 1920, 1939, NULL, '280', 'After centuries of successive rule by Germans, Danes, Swedes, Poles and Russians, a distinct Estonian national identity began to emerge in the 19th and early 20th centuries. This culminated in independence from Russia in 1920 after a brief War of Independence at the end of World War I. Initially democratic prior to the Great Depression, Estonia experienced authoritarian rule from 1934 during the Era of Silence. During World War II (1939–1945), Estonia was repeatedly contested and occupied by the Soviet Union and Germany, ultimately being incorporated into the former. On 6 August 1940, Estonia was annexed by the Soviet Union as the Estonian SSR.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (375, 6, 3, NULL, NULL, 'Latvia', 'Republic of Latvia', 1918, 1940, NULL, '280', 'After centuries of Swedish, Polish-Lithuanian and Russian rule, a rule mainly executed by the Baltic German aristocracy, the Republic of Latvia was established on 18 November 1918 when it broke away from the Russian Empire and declared independence in the aftermath of World War I.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (376, 6, 3, NULL, NULL, 'Lithuania', 'Republic of Lithuania', 1918, 1940, NULL, '280', 'In 1569, Lithuania and Poland formed a voluntary two-state personal union, the Polish–Lithuanian Commonwealth. The Commonwealth lasted more than two centuries, until neighbouring countries dismantled it between 1772 and 1795, with the Russian Empire annexing most of Lithuania''s territory.
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (215, 2, 3, 'TT', 'TTO', 'Trinidad and Tobago', 'Republic of Trinidad and Tobago', 1962, NULL, NULL, NULL, 'The island of Trinidad became a colony in the Spanish Empire, following the arrival of Christopher Columbus in 1498. In 1797 it was surrendered to a British fleet. During the same period, the island of Tobago changed hands among Spanish, British, French, Dutch and Courlander colonisers. Trinidad and Tobago were ceded to Britain in 1802 under the Treaty of Amiens as separate states and unified in 1889. Trinidad and Tobago obtained independence on August 31, 1962, becoming a republic in 1976.');
INSERT INTO public.ter_territory (ter_id, ter_con_id, ter_tty_id, ter_iso2, ter_iso3, ter_name, ter_official_name, ter_start, ter_end, ter_parent_country_id, ter_successor_id, ter_description) VALUES (20, 6, 3, 'BY', 'BLR', 'Belarus', 'Republic of Belarus', 1991, NULL, NULL, NULL, 'Until the 20th century, different states at various times controlled the lands of modern-day Belarus, including Kievan Rus'', the Principality of Polotsk, the Grand Duchy of Lithuania, the Polish–Lithuanian Commonwealth, and the Russian Empire. After the Russian Revolution in 1917, different states arose competing for legitimacy amidst the Civil War, ultimately ending in the rise of the Byelorussian SSR, which became a founding constituent republic of the Soviet Union in 1922. After the Polish-Soviet War, Belarus lost almost half of its territory to Poland. Much of the borders of Belarus took their modern shape in 1939, when some lands of the Second Polish Republic were reintegrated into it after the Soviet invasion of Poland. 
